import React from 'react';
import { Row, Col, Container } from 'react-bootstrap';

const skills = [
  {
    icon: 'fab fa-java',
    color: '#E44D26',
  },
  {
    icon: 'fab fa-css3-alt',
    color: '#264de4',
  },
  {
    icon: 'fab fa-js-square',
    color: '#F0DB4F',
  },
  {
    icon: 'fab fa-react',
    color: '#61DBFB',
  },
  {
    icon: 'fab fa-html5',
    color: '#68A063',
  },
  {
    icon: 'fab fa-docker',
    color: '#c69',
  },
  {
    icon: 'fab fa-aws',
    color: '#Cc3534',
  },
  {
    icon: 'fab fa-github',
    color: '#CC3540',
  },
];

const Experience = () => {
  return (
    <Container>
      <Row className="text-center justify-content-center">
        <Col xs={12}>
          <h1 className="display-4 font-weight-bolder pt-4">Skills</h1>
          <ul className="list-inline">
            {skills.map(({ icon, color }, index) => (
              <li
                className="list-inline-item glow"
                key={index}
                style={{ ['--color']: color }}
              >
                <i className={icon}></i>
              </li>
            ))}
          </ul>
        </Col>
      </Row>
    </Container>
  );
};

export default Experience;
